parameters.inputSchema:
{
	"type": "object",
	"properties": {
		"num_start_page": {
			"type": ["number", null],
          "description": "Starting page at which the sound exchange letter of direction starts"

		},
		"num_end_page": {
			"type": ["number", null],
          "description": "The last page number where the sound exchange letter of direction ends."

        },
      	"soundexchange_file_name": {
			"type": ["number", null],
          "description": "A unique file name(start with sx_log_<time>) for the letter of direction based on the execution time. i.e sx_lod_20250901"

        }
	}
}

parameters.jsCode:
// Expecting $json.pdf_base64 to hold the base64 string
// (without "data:application/pdf;base64," prefix)
const b64 = $('Webhook').first().json.body.pdf_content || "";
const buffer = Buffer.from(b64.replace(/^data:.*;base64,/, ""), "base64");

return {
  json: $json,
  binary: {
    data: {
      data: buffer,
      fileName: $json.file_name || "document.pdf",
      mimeType: "application/pdf",
      fileExtension: "pdf",
    }
  }
};

parameters.text:
=Give me the pages numbers which contains the sound exchange letter of direction from the below;

{{ 
  ($json.pages || [])
    .map((page, idx) => `Page ${idx+1}\n\n${page.markdown}`)
    .join("\n\n---\n\n") 
}}
